pragma solidity ^0.4.24;

import "./SofiaToken.sol";
import "./Controlled.sol";
import "./TokenController.sol";
import "./SafeMath.sol";

contract Extollet is TokenController, Controlled {

    using SafeMath for uint;

    uint256 public startFundingTime;       // In UNIX Time Format
    uint256 public endFundingTime;         // In UNIX Time Format
    uint public volume;
    uint public totalCollected;         // In wei
    uint public totalTokensSold;
    uint public rate;
    SofiaToken public tokenContract;   // The new token for this Campaign
    address public vaultAddress;        // The address to hold the funds donated

// @notice 'Extollet()' initiates the Campaign by setting its funding
// parameters
// @param _startFundingTime The time that the Campaign will be able to
// start receiving funds
// @param _endFundingTime The time that the Campaign will stop being able
// to receive funds
// @param _maximumFunding In wei, the Maximum amount that the Campaign can
// receive
// @param _volume Total volume
// @param _rate Rate in wei
// to receive funds
// @param _vaultAddress The address that will store the donated funds
// @param _tokenAddress Address of the token contract this contract controls

  function Extollet(
      uint256 _startFundingTime,
      uint256 _endFundingTime,
      uint _volume,
      uint _rate,
      address _vaultAddress,
      address _tokenAddress
    ) public {
     require ((_endFundingTime >= now) &&           // Cannot end in the past
              (_endFundingTime > _startFundingTime) &&
              (_volume > 0) &&
              (_rate > 0) &&
              (_vaultAddress != 0));                    // To prevent burning ETH
      startFundingTime = _startFundingTime;
      endFundingTime = _endFundingTime;
      volume = _volume;
      rate = _rate;
      vaultAddress = _vaultAddress;
      totalCollected = 0;
      totalTokensSold = 0;
      tokenContract = SofiaToken(_tokenAddress);// The Deployed Token Contract
      }

// @dev The fallback function is called when ether is sent to the contract, it
// simply calls `doPayment()` with the address that sent the ether as the
// `_owner`. Payable is a required solidity modifier for functions to receive
// ether, without this modifier functions will throw if ether is sent to them

  function () public payable{
    doPayment(msg.sender);
  }
// @dev `doPayment()` is an internal function that sends the ether that this
//  contract receives to the `vault` and creates tokens in the address of the
//  `_owner` assuming the Campaign is still accepting funds
// @param _owner The address that will hold the newly created tokens

  function doPayment(address _owner) internal {
  // Calculate token amount
    uint tokenAmount = getTokenAmount(msg.value);
  // Check that the Campaign is allowed to receive this donation
    require ((now >= startFundingTime) &&
            (now <= endFundingTime) &&
            (tokenContract.controller() != 0) &&           // Extra check
            (msg.value != 0) &&
            ((totalCollected + tokenAmount) <= volume)
            );
  //Track how much the Campaign has collected
    totalCollected += msg.value;
    totalTokensSold += tokenAmount;
  //Send the ether to the vault
    preValidatePurchase(_owner,msg.value);
    require (vaultAddress.send(msg.value));
    require (tokenContract.transfer(_owner,tokenAmount));
    return;
    }

//@dev Validation of an incoming purchase. Use require statemens to revert state when conditions are not met. Use super to concatenate validations.
//@param _beneficiary Address performing the token purchase
//@param _weiAmount Value in wei involved in the purchase

    function preValidatePurchase(address _beneficiary, uint256 _weiAmount) internal {
      require(_beneficiary != address(0));
      require(_weiAmount != 0);
    }
//@dev Override to extend the way in which ether is converted to tokens.
//@param _weiAmount Value in wei to be converted into tokens
//@return Number of tokens that can be purchased with the specified _weiAmount

    function getTokenAmount(uint _weiAmount) internal view returns (uint) {
      return _weiAmount.div(rate);
    }

// @notice `onlyController` changes the location that ether is sent
// @param _newVaultAddress The address that will receive the ether sent to this
    function setVault(address _newVaultAddress) public onlyController {
        vaultAddress = _newVaultAddress;
    }

// @notice `finalizeFunding()` ends the Campaign by calling setting the
//  controller to 0, thereby ending the issuance of new tokens and stopping the
//  Campaign from receiving more ether
// @dev `finalizeFunding()` can only be called after the end of the funding period.
    function finalizeFunding() public onlyController
    {
            require(now >= endFundingTime);
            uint tokensLeft = volume.sub(totalTokensSold);
            require(tokensLeft > 0);
            require(tokenContract.transfer(tokenContract.controller(),tokensLeft));
    }
    ////////////
// TokenController interface
////////////

// @notice `proxyPayment()` allows the caller to send ether to the Campaign and
// have the tokens created in an address of their choosing
// @param _owner The address that will hold the newly created tokens

    function proxyPayment(address _owner) payable returns(bool) {
        doPayment(_owner);
        return true;
    }

// @notice Notifies the controller about a transfer, for this Campaign all
//  transfers are allowed by default and no extra notifications are needed
// @param _from The origin of the transfer
// @param _to The destination of the transfer
// @param _amount The amount of the transfer
// @return False if the controller does not authorize the transfer

    function onTransfer(address _from, address _to, uint _amount) returns(bool) {
        return true;
    }

// @notice Notifies the controller about an approval, for this Campaign all
//  approvals are allowed by default and no extra notifications are needed
// @param _owner The address that calls `approve()`
// @param _spender The spender in the `approve()` call
// @param _amount The amount in the `approve()` call
// @return False if the controller does not authorize the approval

    function onApprove(address _owner, address _spender, uint _amount)
        returns(bool)
    {
        return true;
    }
}
